    function _calculateURI(uint256 id, uint256 module) private pure returns (uint256) {
        uint8[6] memory mult = [2, 3, 4, 5, 6, 7];
        uint256 i = 0;
        uint256 m = 10;
        uint256 num = 0;
        uint256 s = 0;
        while (num != id) {
            if (i == 0) {
                num = id % m;
                uint256 bar = id % m;
                s += (bar * mult[i % 6]);
                i += 1;
                m *= 10;
            }
            else {
                num = id % m;
                uint256 bar = ((id % m) - (id % (m / 10))) / (m / 10);
                s += (bar * mult[i % 6]);
                i += 1;
                m *= 10;
            }
        }
        uint256 z = s / module;
        uint256 r = module + (z * module) - s;
        return r;
    }

